import './App.css';

function App() {
  return (
    <div className="App">
      <nav>
        <main>
          <div className="radarContainer">
            <div className="radar"></div>
            <div className="degreeLabel" id='top'>360</div>
            <div className="degreeLabel" id='right'>90</div>
            <div className="degreeLabel" id='bottom'>180</div>
            <div className="degreeLabel" id='left'>270</div>

            <div className=''>
              {Array.from({ length: 36 }, (_, i) => (
                <div
                  key={i}
                  className={`degreeMarking rotate-${i * 10}`}
                ></div>
              ))}
            </div>
          </div>
        </main>

        <aside>b</aside>
      </nav>

    </div>
  );
}

export default App;
